<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>CLIP vs DINOv2 Clustering Comparison</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            background: #f5f7fa;
            min-height: 100vh;
            color: #333;
        }

        .header {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            padding: 25px 20px;
            text-align: center;
            color: white;
        }

        .header h1 {
            font-size: 24px;
            font-weight: 600;
            margin-bottom: 8px;
        }

        .header p {
            opacity: 0.9;
            font-size: 14px;
        }

        .stats-row {
            display: flex;
            justify-content: center;
            gap: 20px;
            padding: 20px;
            background: white;
            border-bottom: 1px solid #e5e7eb;
            flex-wrap: wrap;
        }

        .stat-card {
            text-align: center;
            padding: 15px 25px;
            background: #f9fafb;
            border-radius: 10px;
        }

        .stat-card.clip {
            border: 2px solid #3b82f6;
        }

        .stat-card.dino {
            border: 2px solid #10b981;
        }

        .stat-value {
            font-size: 28px;
            font-weight: 700;
        }

        .stat-card.clip .stat-value {
            color: #3b82f6;
        }

        .stat-card.dino .stat-value {
            color: #10b981;
        }

        .stat-label {
            font-size: 12px;
            color: #666;
            margin-top: 4px;
        }

        .tabs {
            display: flex;
            justify-content: center;
            gap: 10px;
            padding: 15px;
            background: white;
            border-bottom: 1px solid #e5e7eb;
        }

        .tab {
            padding: 10px 25px;
            border: none;
            border-radius: 8px;
            font-size: 14px;
            font-weight: 500;
            cursor: pointer;
            transition: all 0.2s;
            background: #f0f0f0;
            color: #666;
        }

        .tab:hover {
            background: #e0e0e0;
        }

        .tab.active {
            color: white;
        }

        .tab.active.clip-tab {
            background: #3b82f6;
        }

        .tab.active.dino-tab {
            background: #10b981;
        }

        .tab.active.side-tab {
            background: #8b5cf6;
        }

        .container {
            max-width: 1400px;
            margin: 0 auto;
            padding: 20px;
        }

        .view {
            display: none;
        }

        .view.active {
            display: block;
        }

        .cluster-card {
            background: white;
            border-radius: 12px;
            margin-bottom: 20px;
            overflow: hidden;
            box-shadow: 0 2px 8px rgba(0,0,0,0.08);
        }

        .cluster-header {
            padding: 12px 16px;
            color: white;
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        .cluster-header.clip {
            background: #3b82f6;
        }

        .cluster-header.dino {
            background: #10b981;
        }

        .cluster-header.noise {
            background: #6b7280;
        }

        .cluster-title {
            font-weight: 600;
            font-size: 14px;
        }

        .cluster-count {
            font-size: 13px;
            opacity: 0.9;
        }

        .cluster-photos {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(120px, 1fr));
            gap: 10px;
            padding: 15px;
        }

        .photo-card {
            position: relative;
            border-radius: 8px;
            overflow: hidden;
            cursor: pointer;
            transition: transform 0.2s, box-shadow 0.2s;
            border: 2px solid transparent;
        }

        .photo-card:hover {
            transform: scale(1.05);
            box-shadow: 0 4px 15px rgba(0,0,0,0.2);
        }

        .photo-card img {
            width: 100%;
            height: 100px;
            object-fit: cover;
            display: block;
        }

        .photo-card .other-cluster {
            position: absolute;
            bottom: 0;
            left: 0;
            right: 0;
            background: rgba(0,0,0,0.7);
            color: white;
            font-size: 10px;
            padding: 3px 6px;
            text-align: center;
        }

        .photo-card.highlighted {
            border-color: #fbbf24;
            box-shadow: 0 0 0 3px rgba(251, 191, 36, 0.5);
        }

        /* Side by Side View */
        .side-by-side {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 20px;
        }

        .side-column {
            background: white;
            border-radius: 12px;
            overflow: hidden;
        }

        .side-column-header {
            padding: 15px;
            color: white;
            text-align: center;
            font-weight: 600;
        }

        .side-column-header.clip {
            background: #3b82f6;
        }

        .side-column-header.dino {
            background: #10b981;
        }

        .side-column-content {
            padding: 15px;
            max-height: 70vh;
            overflow-y: auto;
        }

        /* Modal */
        .modal {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: rgba(0,0,0,0.8);
            display: none;
            align-items: center;
            justify-content: center;
            z-index: 1000;
        }

        .modal.active {
            display: flex;
        }

        .modal-content {
            background: white;
            border-radius: 12px;
            padding: 25px;
            max-width: 500px;
            text-align: center;
        }

        .modal-content img {
            max-width: 300px;
            max-height: 300px;
            border-radius: 8px;
            margin-bottom: 15px;
        }

        .modal-content h3 {
            font-size: 14px;
            margin-bottom: 15px;
            word-break: break-all;
        }

        .modal-clusters {
            display: flex;
            justify-content: center;
            gap: 20px;
        }

        .modal-cluster {
            padding: 10px 20px;
            border-radius: 8px;
            color: white;
            font-weight: 600;
        }

        .modal-cluster.clip {
            background: #3b82f6;
        }

        .modal-cluster.dino {
            background: #10b981;
        }

        .modal-close {
            margin-top: 20px;
            padding: 10px 30px;
            background: #e0e0e0;
            border: none;
            border-radius: 8px;
            cursor: pointer;
            font-size: 14px;
        }

        @media (max-width: 768px) {
            .side-by-side {
                grid-template-columns: 1fr;
            }

            .cluster-photos {
                grid-template-columns: repeat(auto-fill, minmax(80px, 1fr));
            }

            .photo-card img {
                height: 70px;
            }
        }
    </style>
</head>
<body>
    <div class="header">
        <h1>CLIP vs DINOv2 Clustering Comparison</h1>
        <p>Experiment: Does DINOv2 cluster by scene instead of person identity?</p>
    </div>

    <div class="stats-row">
        <div class="stat-card clip">
            <div class="stat-value">18</div>
            <div class="stat-label">CLIP Clusters</div>
        </div>
        <div class="stat-card clip">
            <div class="stat-value">86</div>
            <div class="stat-label">CLIP Noise</div>
        </div>
        <div class="stat-card dino">
            <div class="stat-value">18</div>
            <div class="stat-label">DINOv2 Clusters</div>
        </div>
        <div class="stat-card dino">
            <div class="stat-value">75</div>
            <div class="stat-label">DINOv2 Noise</div>
        </div>
    </div>

    <div class="tabs">
        <button class="tab clip-tab active" onclick="showView('clip')">CLIP Clusters</button>
        <button class="tab dino-tab" onclick="showView('dino')">DINOv2 Clusters</button>
        <button class="tab side-tab" onclick="showView('side')">Side by Side</button>
    </div>

    <div class="container">
        <div id="clip-view" class="view active"></div>
        <div id="dino-view" class="view"></div>
        <div id="side-view" class="view"></div>
    </div>

    <!-- Modal -->
    <div id="photo-modal" class="modal" onclick="closeModal()">
        <div class="modal-content" onclick="event.stopPropagation()">
            <img id="modal-img" src="" alt="">
            <h3 id="modal-filename"></h3>
            <div class="modal-clusters">
                <div class="modal-cluster clip">
                    CLIP: <span id="modal-clip-cluster"></span>
                </div>
                <div class="modal-cluster dino">
                    DINOv2: <span id="modal-dino-cluster"></span>
                </div>
            </div>
            <button class="modal-close" onclick="closeModal()">Close</button>
        </div>
    </div>

        function showView(view) {
            // Update tabs
            document.querySelectorAll('.tab').forEach(t => t.classList.remove('active'));
            document.querySelector(`.tab.${view}-tab`).classList.add('active');

            // Update views
            document.querySelectorAll('.view').forEach(v => v.classList.remove('active'));
            document.getElementById(`${view}-view`).classList.add('active');
        }

        function renderClusters(groups, type, containerId) {
            const container = document.getElementById(containerId);
            container.innerHTML = '';

            // Sort clusters by ID (noise last)
            const sortedIds = Object.keys(groups).map(Number).sort((a, b) => {
                if (a === -1) return 1;
                if (b === -1) return -1;
                return a - b;
            });

            for (const clusterId of sortedIds) {
                const files = groups[clusterId];
                const isNoise = clusterId === -1;

                const card = document.createElement('div');
                card.className = 'cluster-card';

                const headerClass = isNoise ? 'noise' : type;
                const title = isNoise ? 'Noise (Unclustered)' : `Cluster #${clusterId}`;

                card.innerHTML = `
                    <div class="cluster-header ${headerClass}">
                        <span class="cluster-title">${title}</span>
                        <span class="cluster-count">${files.length} photos</span>
                    </div>
                    <div class="cluster-photos" id="${type}-cluster-${clusterId}"></div>
                `;

                container.appendChild(card);

                const photosContainer = card.querySelector('.cluster-photos');
                for (const fn of files) {
                    const data = photoData[fn];
                    if (!data || !data.thumbnail) continue;

                    const otherCluster = type === 'clip' ? data.dino_cluster : data.clip_cluster;
                    const otherType = type === 'clip' ? 'DINO' : 'CLIP';

                    const photoCard = document.createElement('div');
                    photoCard.className = 'photo-card';
                    photoCard.onclick = () => openModal(fn);
                    photoCard.innerHTML = `
                        <img src="${data.thumbnail}" alt="${fn}">
                        <div class="other-cluster">${otherType}: #${otherCluster}</div>
                    `;
                    photosContainer.appendChild(photoCard);
                }
            }
        }

        function renderSideBySide() {
            const container = document.getElementById('side-view');
            container.innerHTML = `
                <div class="side-by-side">
                    <div class="side-column">
                        <div class="side-column-header clip">CLIP Clusters (Semantic)</div>
                        <div class="side-column-content" id="side-clip"></div>
                    </div>
                    <div class="side-column">
                        <div class="side-column-header dino">DINOv2 Clusters (Visual)</div>
                        <div class="side-column-content" id="side-dino"></div>
                    </div>
                </div>
            `;

            renderClusters(clipGroups, 'clip', 'side-clip');
            renderClusters(dinoGroups, 'dino', 'side-dino');
        }

        function openModal(filename) {
            const data = photoData[filename];
            document.getElementById('modal-img').src = data.thumbnail;
            document.getElementById('modal-filename').textContent = filename;
            document.getElementById('modal-clip-cluster').textContent =
                data.clip_cluster === -1 ? 'Noise' : `#${data.clip_cluster}`;
            document.getElementById('modal-dino-cluster').textContent =
                data.dino_cluster === -1 ? 'Noise' : `#${data.dino_cluster}`;
            document.getElementById('photo-modal').classList.add('active');
        }

        function closeModal() {
            document.getElementById('photo-modal').classList.remove('active');
        }

        // Initialize
        renderClusters(clipGroups, 'clip', 'clip-view');
        renderClusters(dinoGroups, 'dino', 'dino-view');
        renderSideBySide();

        // Keyboard shortcut
        document.addEventListener('keydown', (e) => {
            if (e.key === 'Escape') closeModal();
        });
    </script>
